(1, 'CONSUMO TELEVISIVO POR TARGETS SOCIO-DEMOGRAFICO', 'CONSUMO TELEVISIVO POR TARGETS SOCIO-DEMOGRAFICO', 'SELECT fecha, tipotv_id, tipo_tv, canal_id, canal, indicador_id, indicador, categoria, amr miles, porcentaje_amr, porcentaje_shr FROM vista_totales\r\nwhere categoria IN (''CLASE SOCIAL'',''EDAD'',''SEXO'')', 'reporte_consumo-televisivo-sociodemografico.html.twig'),
(2, 'CONSUMO TELEVISIVO POR ÁMBITOS', 'CONSUMO TELEVISIVO POR ÁMBITOS', 'SELECT `tipo_tv`, `canal`, `indicador`, `amr` miles, `porcentaje_amr`, `porcentaje_shr` FROM `vista_totales`\r\nwhere categoria = ''REGION''', 'reporte_consumo-televisivo-ambitos.html.twig'),
(3, 'PROGRAMACION POR CANALES', 'PROGRAMACION POR CANALES', 'SELECT @rownum := @rownum +1 AS rownum, aux. * FROM ( SELECT canal, programa, genero, fecha, hora_inicio, amr miles, porcentaje_amr, porcentaje_shr FROM vista_emisiones ORDER BY amr DESC , porcentaje_amr DESC , porcentaje_shr DESC)aux, (SELECT @rownum :=0)r', 'reporte_programacion-canales.html.twig'),
(4, 'REPARTO DE AUDIENCIAS POR CANAL', 'REPARTO DE AUDIENCIAS POR CANAL', 'select vt.canal, vt.tipo_tv, vt.fecha, case when DATE_FORMAT(vt.fecha, ''%W'')= ''Monday'' then ''Lunes'' when DATE_FORMAT(vt.fecha, ''%W'')= ''Tuesday'' then ''Martes'' when DATE_FORMAT(vt.fecha, ''%W'')= ''Wednesday'' then ''Miercoles'' when DATE_FORMAT(vt.fecha,''%W'')= ''Thursday'' then ''Jueves'' when DATE_FORMAT(vt.fecha, ''%W'')= ''Friday''  then ''Viernes'' when DATE_FORMAT(vt.fecha, ''%W'')= ''Saturday''  then ''Sabado'' when DATE_FORMAT(vt.fecha, ''%W'')= ''Sunday''  then ''Domingo'' else DATE_FORMAT(vt.fecha, ''%W'') end  dia_semana, vt.porcentaje_shr, vt.amr, vt.porcentaje_amr from vista_totales vt', 'reporte_reparto-audiencias-canal.html.twig'),
(5, 'Medias Horas', 'Medias horas', 'select * from vista_medias_horas', 'reporte.html.twig'),
(6, 'Ranking', 'Ranking', 'Select * from vista_totales', 'reporte.html.twig');
