CREATE DEFINER=`root`@`localhost` PROCEDURE `carga_archivo`(IN idUsuario INT, IN idProceso INT)
BEGIN

DECLARE  varLote INT;
DECLARE varMaxEmisionId INT;
DECLARE varMaxEmisionSegmentoId INT;
  
SELECT CURRENT_TIMESTAMP(),  idProceso, idUsuario;

select max(id) into varLote from lote;

SELECT DISTINCT canal, 1
FROM tmp_carga
WHERE canal NOT 
IN (SELECT nombre FROM canal);

SELECT DISTINCT programa, 13
FROM tmp_carga
WHERE programa NOT 
IN (SELECT nombre FROM programa);

UPDATE  tmp_carga
inner  JOIN
	canal
ON      canal.nombre = tmp_carga.canal
SET     tmp_carga.canal_id = canal.id;

UPDATE  tmp_carga
inner  JOIN
	programa
ON      programa.nombre = tmp_carga.programa
SET     tmp_carga.programa_id = programa.id;

UPDATE  tmp_carga
inner  JOIN
	indicador
ON      indicador.nombre = tmp_carga.indicador
SET     tmp_carga.indicador_id = indicador.id;

IF (idProceso = 1) THEN
	/*ACTUALIZO LOS VALORES YA EXISTEN POR FECHA, HORA, INIDICADOR Y CANAL*/
	UPDATE  indicador_emision_segmento
	INNER  JOIN
		tmp_carga tmp
	ON      tmp.indicador_id = indicador_emision_segmento.indicador_id
	INNER JOIN 
		emisiones_segmento es on indicador_emision_segmento.emision_segmento_id = es.id
		AND tmp.hora_inicio = es.hora_inicio 
		AND tmp.hora_fin = es.hora_fin
	INNER JOIN 
		emisiones e on e.id = es.emision_id	AND 
		tmp.canal_id = e.canal_id AND 
		DATE_FORMAT( tmp.fecha,  '%d%m%Y') = DATE_FORMAT( e.fecha,  '%d%m%Y') 

	SET     indicador_emision_segmento.porcentaje_shr = tmp.porcentaje_shr, 
		indicador_emision_segmento.amr = tmp.amr, 
		indicador_emision_segmento.porcentaje_amr = tmp.porcentaje_amr, 
		indicador_emision_segmento.rch = tmp.rch, 
		indicador_emision_segmento.ats = tmp.ats,
		indicador_emision_segmento.fecha_modificacion = (SELECT fecha FROM lote WHERE ID = varLote),
		indicador_emision_segmento.lote_id = varLote;

	/*BORRO DE LA TEMPORAL DE CARGA LOS REGISTROS QUE YA EXISTEN*/
	DELETE tmp 
	FROM tmp_carga tmp INNER JOIN 
		indicador_emision_segmento ON tmp.indicador_id = indicador_emision_segmento.indicador_id INNER JOIN 
		emisiones_segmento es ON indicador_emision_segmento.emision_segmento_id = es.id AND 
			tmp.hora_inicio = es.hora_inicio AND 
			tmp.hora_fin = es.hora_fin INNER JOIN 
		emisiones e ON e.id = es.emision_id AND 
			tmp.canal_id = e.canal_id AND 
			DATE_FORMAT( tmp.fecha,  '%d%m%Y' ) = DATE_FORMAT( e.fecha,  '%d%m%Y' );


	/*INSERTO LOS QUE NO EXISTEN EN TABLAS*/
	select ifnull(max(id),0) into varMaxEmisionId from emisiones;

	SELECT DATE_FORMAT(fecha,  '%Y-%m-%d'),programa_id, canal_id
	FROM tmp_carga
	GROUP BY DATE_FORMAT(fecha,  '%Y-%m-%d'),programa_id, canal_id;

	select ifnull(max(id),0) into varMaxEmisionSegmentoId from emisiones_segmento;

	SELECT distinct e.id,  tmp.hora_inicio, tmp.hora_fin 
	FROM tmp_carga tmp
		INNER JOIN emisiones e ON tmp.canal_id = e.canal_id
		AND tmp.programa_id = e.programa_id
		AND DATE_FORMAT( tmp.fecha,  '%d %m %Y') = DATE_FORMAT( e.fecha,  '%d %m %Y') 
	WHERE e.id > varMaxEmisionId;

	SELECT distinct es.id, tmp.indicador_id, porcentaje_shr,amr,porcentaje_amr,rch,ats,varLote , CURRENT_TIMESTAMP(),CURRENT_TIMESTAMP()
	FROM tmp_carga tmp
	INNER JOIN emisiones e ON tmp.canal_id = e.canal_id
		AND tmp.programa_id = e.programa_id
		AND DATE_FORMAT( tmp.fecha,  '%d %m %Y' ) = DATE_FORMAT( e.fecha,  '%d %m %Y' ) 
	INNER JOIN emisiones_segmento es ON es.emision_id = e.id
		AND tmp.hora_inicio = es.hora_inicio 
		AND tmp.hora_fin = es.hora_fin 
	WHERE es.id >varMaxEmisionSegmentoId ;

END IF;		

IF (idProceso = 2) THEN

	/*ACTUALIZO LOS VALORES YA EXISTEN POR FECHA, INIDICADOR Y CANAL*/
	UPDATE  indicador_totales_fecha 
	inner  JOIN
		tmp_carga
	ON      DATE_FORMAT( tmp_carga.fecha,  '%d %m %Y') = DATE_FORMAT( indicador_totales_fecha.fecha,  '%d %m %Y') 
		AND tmp_carga.canal_id = indicador_totales_fecha.canal_id
		AND tmp_carga.indicador_id = indicador_totales_fecha.indicador_id
	SET     indicador_totales_fecha.porcentaje_shr = tmp_carga.porcentaje_shr, 
		indicador_totales_fecha.amr = tmp_carga.amr, 
		indicador_totales_fecha.porcentaje_amr = tmp_carga.porcentaje_amr, 
		indicador_totales_fecha.rch = tmp_carga.rch, 
		indicador_totales_fecha.ats = tmp_carga.ats,
		indicador_totales_fecha.fecha_modificacion = CURRENT_TIMESTAMP(),
		indicador_totales_fecha.lote_id = varLote;

	/*INSERTO LOS QUE NO EXISTEN*/

	SELECT canal_id, indicador_id, fecha, porcentaje_shr, amr, porcentaje_amr, rch, ats, varLote, CURRENT_TIMESTAMP()
	FROM tmp_carga 
	WHERE CONCAT(canal_id,indicador_id,DATE_FORMAT( tmp_carga.fecha,  '%d%m%Y')) NOT IN (SELECT CONCAT(canal_id,indicador_id,DATE_FORMAT(indicador_totales_fecha.fecha,  '%d%m%Y'))  FROM indicador_totales_fecha) ;

END IF;

IF (idProceso = 3) THEN

	UPDATE tmp_carga
	SET fecha = IF(LEFT(hora_inicio,2)>23, DATE_ADD(fecha,INTERVAL 1 DAY),fecha); 

	UPDATE tmp_carga 
	SET 
		hora_inicio = IF(LEFT(hora_inicio,2)>23, CONCAT('0',(LEFT(hora_inicio,2 )-24),':',RIGHT(hora_inicio,6)),hora_inicio),	
		hora_fin = IF(LEFT(hora_inicio,2)>23, CONCAT('0',(LEFT(hora_fin,2 )-24),':',RIGHT(hora_fin,6)),hora_fin);
	
	UPDATE  indicador_medias_horas
	inner  JOIN
		tmp_carga
	ON      DATE_FORMAT( tmp_carga.fecha,  '%d %m %Y') = DATE_FORMAT( indicador_medias_horas.fecha,  '%d %m %Y') 
		AND tmp_carga.canal_id = indicador_medias_horas.canal_id
		AND tmp_carga.indicador_id = indicador_medias_horas.indicador_id
		AND tmp_carga.indicador_id = indicador_medias_horas.indicador_id
		AND tmp_carga.hora_inicio = indicador_medias_horas.hora_inicio
		AND tmp_carga.hora_fin = indicador_medias_horas.hora_fin

	SET     
    indicador_medias_horas.porcentaje_shr = tmp_carga.porcentaje_shr, 
		indicador_medias_horas.amr = tmp_carga.amr, 
		indicador_medias_horas.porcentaje_amr = tmp_carga.porcentaje_amr, 
		indicador_medias_horas.rch = tmp_carga.rch, 
		indicador_medias_horas.ats = tmp_carga.ats,
		indicador_medias_horas.fecha_modificacion = CURRENT_TIMESTAMP(),
		indicador_medias_horas.lote_id = varLote;
		
	
	SELECT canal_id, indicador_id, fecha, porcentaje_shr, amr, porcentaje_amr, rch, ats, varLote, CURRENT_TIMESTAMP(), hora_inicio, hora_fin
	FROM tmp_carga 
	WHERE CONCAT(canal_id,indicador_id,DATE_FORMAT( tmp_carga.fecha,  '%d%m%Y'),hora_inicio, hora_fin) NOT IN (SELECT CONCAT(canal_id,indicador_id,DATE_FORMAT		(indicador_medias_horas.fecha,  '%d%m%Y'),hora_inicio, hora_fin)  FROM indicador_medias_horas) ;

END IF;

UPDATE lote SET descripcion = 'Carga Satistactoria' WHERE id =varLote;
delete from tmp_carga;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `preparaValoresParametros`(IN canales varchar(100), IN perfiles varchar(100))
BEGIN

DECLARE i int;
  SET I=0;
  SET @id="";

DROP TEMPORARY TABLE  IF EXISTS valores_temp1;
/*canales*/
CREATE TEMPORARY TABLE valores_temp1
 (
      id int
 ) ;

DROP TEMPORARY TABLE  IF EXISTS valores_temp2;
/*perfiles*/
CREATE TEMPORARY TABLE valores_temp2
 (
      id int
 ) ;

/*CANALES*/
  label1: LOOP
    
    SET i = i + 1;
    IF i <= CHAR_LENGTH(canales)  THEN
       IF SUBSTRING(  canales, i, 1 ) != "," and SUBSTRING(  canales, i, 1 ) != "'" THEN
         SET @id = concat(@id , SUBSTRING(  canales, i, 1 ));       
          IF i = CHAR_LENGTH(canales) THEN
              SELECT @id;
          END IF;
        ELSE 
         SELECT @id;

         SET @id="";
        END IF;
    ITERATE label1;
  
    END IF;
    LEAVE label1;
  END LOOP label1;

 SET i = 0;
SET @id="";
/*PERFILES*/
  label2: LOOP
    
    SET i = i + 1;
    IF i <= CHAR_LENGTH(perfiles)  THEN
       IF SUBSTRING(  perfiles, i, 1 ) != "," and SUBSTRING(  perfiles, i, 1 ) != "'" THEN
         SET @id = concat(@id , SUBSTRING(  perfiles, i, 1 ));       
          IF i = CHAR_LENGTH(perfiles) THEN
              SELECT @id;
          END IF;
        ELSE 
         SELECT @id;

         SET @id="";
        END IF;
    ITERATE label2;
  
    END IF;
    LEAVE label2;
  END LOOP label2;



END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `repTargetsSocioDemo`(IN canales VARCHAR(100),  IN fechaIni Date, IN fechaFin Date , IN indicadores INT, IN perfiles VARCHAR(100) )
BEGIN
 
call preparaValoresParametros (canales , perfiles);
  

	SELECT  
		canal_id, 
		concat(repeat('0',4-length(`orden_tipo_tv`)),`orden_tipo_tv`,`tipo_tv`) tipo_tv,  
		concat(repeat('0',4-length(`orden_canal`)),`orden_canal`,`canal`) canal , 
		concat(repeat('0',4-length(`orden_categoria`)),`orden_categoria`,`categoria`) categoria , 
		concat(repeat('0',4-length(`orden_indicador`)),`orden_indicador`,`indicador`) indicador, 
		fecha,
		CASE indicadores 
			WHEN 1 THEN porcentaje_shr  
			WHEN 2 THEN amr  
			WHEN 3 THEN porcentaje_amr
			WHEN 4 THEN rch
		END valor, 
		orden_tipo_tv, 
		orden_canal, 
		orden_categoria, 
		orden_indicador,
		case 
			when DATE_FORMAT(fecha , '%W')= 'Monday' then concat(DATE_FORMAT(fecha , '%d%m%Y'), 'LUNES' , '  ' , DATE_FORMAT(fecha , '%d-%m-%Y'))
			when DATE_FORMAT(fecha , '%W')= 'Tuesday'  then  concat(DATE_FORMAT(fecha , '%d%m%Y'),'MARTES' ,'  ' ,  DATE_FORMAT(fecha , '%d-%m-%Y'))
			when DATE_FORMAT(fecha , '%W')= 'Wednesday' then concat(DATE_FORMAT(fecha , '%d%m%Y'),'MIERCOLES', '  ' , DATE_FORMAT(fecha ,'%d-%m-%Y'))
			when DATE_FORMAT(fecha , '%W')= 'Thursday' then concat(DATE_FORMAT(fecha , '%d%m%Y'),'JUEVES', '  ' , DATE_FORMAT(fecha ,'%d-%m-%Y'))
			when DATE_FORMAT(fecha , '%W')= 'Friday'  then concat(DATE_FORMAT(fecha , '%d%m%Y'),'VIERNES', '  ' , DATE_FORMAT(fecha , '%d %m %Y'))
			when DATE_FORMAT(fecha , '%W')= 'Saturday'  then concat(DATE_FORMAT(fecha , '%d%m%Y'),'SABADO', '  ' , DATE_FORMAT(fecha , '%d-%m-%Y'))
			when DATE_FORMAT(fecha , '%W')= 'Sunday'  then concat(DATE_FORMAT(fecha , '%d%m%Y'),'DOMINGO', '  ' , DATE_FORMAT(fecha , '%d-%m-%Y'))	  
			ELSE DATE_FORMAT(fecha, '%W') 
		END  dia_semana

	FROM  vista_totales 
	WHERE fecha between fechaIni and fechaFin 
		and canal_id IN(select id from valores_temp1) 
		and indicador_id in (select id from valores_temp2)
	order by 
		orden_tipo_tv, 
		orden_canal, 
		orden_categoria, 
		orden_indicador; 
 

END$$

